import logo from './logo.svg';
import './App.css';
import countries from 'world-countries';

const CountryInfo = ({data}) => {
  console.log(data)
  return (
    <p>
      Country name {data.name.common};
    </p>
  );
}
function App() {
  console.log(countries);
  const Countrycomp = countries.map(country => <CountryInfo data = {country}/>)
  return (
    <div className="App">
      {
        Countrycomp
      }
    </div>
  );
}



export default App;
